import React from 'react'
import LoginInputComponent from './LoginInputComponent'

function LoginFormComponents() {

    // cb, text, name, placeholder, classInput, classLabel

    const handleChange=(e)=>{console.log(e.target.value)}

    const classInput='bg-green-200 '

    const classLabel='bg-blue-200 '

    const classDiv='flex flex-col items-start justify-around px-4 w-96 h-24 '

    return (
        <div class='flex flex-col'>
            <LoginInputComponent    cb={handleChange} 
                                    text={'input prueba'} 
                                    name={'username'}
                                    placeholder={'username'}
                                    classInput={classInput}
                                    classLabel={classLabel}
                                    classDiv={classDiv}
                    />
            <LoginInputComponent    cb={handleChange} 
                                    text={'input prueba'} 
                                    name={'username'}
                                    placeholder={'username'}
                                    classInput={classInput}
                                    classLabel={classLabel}
                                    classDiv={classDiv}
                    />
        </div>
    )
}

export default LoginFormComponents
